import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	item_Name: {
		fontFamily: "Roboto",
		fontWeight: "1000",
		fontSize: "14px",
		fontStyle: "normal",
	},
	item_Type: {
		color: "#838383",
		fontFamily: "Roboto",
		fontStyle: "normal",
		fontWeight: "500",
		fontSize: "12px",
		lineHeight: "14px",
	},
	item_Stock: {},
	item_Location: {
		color: "#838383",
		fontFamily: "Roboto",
		fontStyle: "normal",
		fontWeight: "500",
		fontSize: "12px",
		lineHeight: "14px",
	},
}));
